import { React } from 'react';
import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-quartz.css';
import { Routes, Route } from "react-router-dom";
import ReadOrder from './omsOrder/ReadOrder';
import ReadOrderList from './omsOrder/ReadOrderList';
import PlaceOrder from './omsOrder/PlaceOrder';
import UpdateOrder from './omsOrder/UpdateOrder';
import ViewDetails from './omsOrder/ViewDetails';

import Creat from './test/Creat';
import Test2 from './test/Test2';
import Test from './test/Test';
import MyNavbar from './omsOrder/MyNavbar'
import ReadComplaintMob from './omsOrder/ReadComplaintMob';


function App() {
  return (
    <div style={{ background: "white" }} >
      <MyNavbar />
      <div  style={{ marginTop: "50px" }}>
        <ReadOrder />
      </div>
      <div  style={{ marginTop: "50px" }}>
        <ReadComplaintMob />
      </div>
      <Routes>
      <Route exact path="/" element={<ReadOrder />} />
        <Route exact path="/:mobileNo" element={<ReadOrder />} />
        <Route exact path="/" element={<ReadOrderList />} />
        <Route exact path="/placeorder" element={<PlaceOrder />} />
        <Route exact path="/updateorder/:displayOrderId" element={<UpdateOrder />} />
        <Route exact path="/viewdetails" element={<ViewDetails />} />
        <Route exact path="/c" element={<Creat />} />
        <Route exact path="/t2" element={<Test2 />} />
        <Route exact path="/t" element={<Test />} />
        <Route exact path="c/:mobileNo" element={<ReadComplaintMob />} />
      </Routes>
    </div>
  );
}
export default App;
